import { FC, useState, useEffect } from "react";
import React from 'react';
import { PartnersPage } from "../api/domain/partners-page";
import { ApiServiceImpl } from "../api/api-service";
import { Table } from 'react-bootstrap';
import { PartnerType } from "../api/domain";
import Container from 'react-bootstrap/Container'
import Row from 'react-bootstrap/Row'
import Col from 'react-bootstrap/Col'




export const PartnersTable : FC = () => {

    const [dataPage, setDataPage] = useState<PartnersPage>();

    useEffect(() => {
        ApiServiceImpl.instance.getPartners(0, 10)
        .then(res => setDataPage(res))
    }, []);
    console.log([dataPage])
    return (
      <Container fluid>
        <Row>
        <Col>
        <Table striped bordered hover>
        <thead>
          <tr>
            <th>Имя партнера</th>
            <th>Тип партнера</th>
            <th>Город</th>
            <th>Адрес</th>
            <th>кнопки</th>
          </tr>
        </thead>
        <tbody>
          {dataPage?.items.map(item => {
            return (<tr key={item.id}>
              <td>{item.displayName}</td>
              <td>{item.partnerType === PartnerType.legalEntity ? "Юридическое лицо" : "Физическое лицо"}</td>
              <td>{item.city}</td>
              <td>{item.address}</td>
              <td></td>
            </tr>);
          })}
        </tbody>
      </Table> 
      </Col>
      </Row>
      </Container>
    )
}
